 [Classic] Hard At Work (1990) - Carol Cummings, Charlotte Leigh, Nikki Knight, Tamara Lee [DVDRip] 
 Shy poor Tamara Lee, she's ready to start a new career in the business world, but her bosses won't even let her sit at her own desk; they all want her to work with them.... in the back room. Naked. On her back. In the most compromising positions. It's not that she doesn't enjoy these closed door meetings, as a matter of fact she gets so excited she regularly loses her self control and engages in all sorts of undignified acts. It's just that she feels that she's not getting anywhere. But she will; as soon as she learns that the only way to get ahead.... is to give some. 
